import React from "react";
import "./main.css";

const GalleryBox = (props) => {
  return (
    <div>
      <div className="box">
        <img src={props.img} alt="" />
        <div className="content">
          <h3>{props.place}</h3>
          <p>
            {props.data}
          </p>
        </div>
      </div>
    </div>
  );
};

export default GalleryBox;
